A SECRETARIA DE ESTADO DE HABITACAO, REGULARIZACAO E DESENVOLVIMEN-
TO URBANO DO DISTRITO FEDERAL E O DIRETOR-PRESIDENTE DA COMPANHIA 
DE DESENVOLVIMENTO HABITACIONAL DO DISTRITO FEDERAL, no uso de suas 
atribuicoes, combinado com o disposto na Lei Federal no 8.666/1993, RESOLVEM:
Art. 1 Criar a Comissao Permanente de Chamamento Conjunta CODHAB/SEDHAB-CPC, 
para recebimento, analise, julgamento e selecao das propostas apresentadas aos Editais de 
Chamamento  CODHAB, que visam a producao de unidades habitacionais para atendimento a 
beneficiarios da Politica Habitacional de Interesse Social do Distrito Federal.
Art. 2 Designar os servidos abaixo relacionados para comporem a Comissao Permanente de 
Chamamento Conjunta CODHAB/SEDHAB, sob a presidencia do primeiro e secretariado pelo 
ultimo, sendo o Presidente substituido pelo segundo membro em suas ausencias e impedimentos: 
MARCIA GUEDES DA CUNHA MARTINEZ, Matricula Codhab no 6033, ANDRE BELLO, 
matricula Sedhab no 126.724-8, MARCUS VINICIUS TANAN DE OLIVEIRA, matricula Codhab 
no 544-4, SIMONE CARVALHO SILVA, matricula Codhab no 485-5 e EUGENIO MARACAJA 
DE MORAES, matricula Sedhab no 264.274-3.
Art. 3 - Cabera ao Presidente da Comissao: 
I  Convocar formalmente os demais membros para a participacao nas reunioes, com antece-
dencia minima de 24 horas;
II  abrir, presidir e coordenar a lavratura das atas e encerrar as sessoes da Comissao;
III  promover as medidas necessarias a realizacao do Chamamento;
IV  anunciar as deliberacoes da Comissao;
V  informar os recursos interpostos contra ato da Comissao;
VI  instruir os processos a cargo da Comissao, determinando a juntada ou desentranhamento 
de documentos pertinentes;
VII  resolver, quando forem de sua competencia exclusiva, os pedidos apresentados 
nas sessoes publicas;
VIII  votar;
IX  solicita informacoes necessarias a tramitacao dos processos a cargo da Comissao e prestar 
informacoes sempre que solicitadas;
X  relacionar-se com terceiros, estranhos ou nao a Administracao, no que pertine aos interesses 
da Comissao a que preside;
XI  solicitar a autoridade competente servidores para o desempenho de funcoes burocraticas 
pertinentes a Comissao. 
Art. 4o - Sao atribuicoes principais dos demais membros:
I  participar das sessoes;
II  rubricar os documentos de habilitacao e os relativos as propostas;
III  votar;
IV  assinar as atas das reunioes das quais participarem;
V  auxiliar o Presidente em suas tarefas e atender as suas determinacoes.

Art. 21. Sao deveres dos usuarios: 
I - Preservar o patrimonio e o acervo da Biblioteca Setorial do HRT; 
II - Tratar com respeito todos os servidores da Biblioteca; 
III - Manter silencio no local de estudo; 
IV - Deixar os livros consultados sobre a mesa proxima ao Acervo; 
V - Manter regularizada sua situacao na Biblioteca Setorial do HRT; 
VI - Manter o cadastro atualizado; 
VII - Utilizar material de consumo proprio como papel, lapis, etc.; 
VIII - Devolver no prazo estipulado a obra emprestada no balcao de atendimento ao servidor 
da Biblioteca Setorialdo HRT; 
IX - Permitir, na saida da Biblioteca, a vistoria de materiais, pastas, bolsas, mochilas e volumes; 
X - Identificar-se sempre que solicitado;
XI  Logar o computador a ser utilizado com sua matricula e senha e encerra-lo ao sair da 
Biblioteca Setorial do HRT;
XII - Salvar os arquivos/trabalhos elaborados nos computadores da Biblioteca Setorial do HRT 
em pen drive ou enviar por e-mail pessoal; 
XIII - Desligar os computadores 10 (dez) minutos antes do fechamento da Biblioteca. 
Art. 22. E proibido ao usuario: 
I - Entrar com alimentos ou bebidas nas dependencias da Biblioteca Setorial do HRT; 
II - Usar o celular; 
III - Fumar; 
IV - Instalar/baixar ou desinstalar programas nos computadores da Biblioteca; 
V - Alterar as configuracoes do sistema e de padroes dos aplicativos dos computadores; 
VI - Acessar sites indevidos: pornograficos, jogos, orkut, facebook, salas de bate-papo, etc.; 
VII - Efetuar troca de mouses dos computadores, teclados e demais perifericos; 
VIII - Danificar, rasgar ou rabiscar o material consultado.

